class Details extends Component {
    render() { 
        return (  
            <Tabs>
                <TabList>
                    <Tab>Overview</Tab>
                    <Tab>Contact</Tab>
                </TabList>

                <TabPanel>
                    <h2>Any content 1</h2>
                </TabPanel>
                <TabPanel>
                    <h2>Any content 2</h2>
                </TabPanel>
            </Tabs>
        );
    }
}

export default Details;







